- input: "TEXT\x1CC00178418\x1C.TEXT\x1C\x1CF3A\x1CThis amended report is being submitted
    in response to the Commission's letter dated April 5, 2013.  With regard to excessive
    donations made by this committee to federal candidates, we mistakenly believed
    that a principal campaign committee could contribute to federal candidates at
    the same level as individuals.  We have instituted new policies to ensure that
    this committee does not make excessive contributions to federal candidates in
    the future.  Please note that the excessive donation made to Kaine for Virginia
    has been refunded to our committee.  This refund was reported on our Year End
    2012 Report.  Once we became aware of the excessive contibution to Flaccavento
    for the 9th, we contacted that Committee requesting a refund.  We were advised
    that Flaccavento for the 9th has closed its account.  That Committee is unable
    to issue the refund because it has no remaining funds.  We would respectfully
    request that since this was an isolated incident and since our donation was only
    $500.00 over the contribution limit, that no further action be taken by the Commission
    on this matter.  With regard to the improper designation of expdenditures listed
    on Line 21, this amended report reflects the correct election designations.\n"
